INSERT INTO `tb_emails` (`id`, `title`, `group`, `message`, `mod`, `time`) VALUES
(1, 'Testing Purpose', 'tb_subscribers', '                                                        <h1>An Important Update</h1>\r\n                                                        <p class=\"copy-18\">Dear <!--?= $name; ?-->Murshid,</p>\r\n                                                        <p class=\"copy-16\">I know your inbox is probably full of emails similar to this, but I felt it was important to let you know about the crucial steps has taken to ensure our employees continued safety throughout\r\n                                                            the COVID-19 (Coronavirus) pandemic, and reassure you there is no change to your service.</p>\r\n                                                        <p class=\"copy-16\">It\'s important for everyone to do their bit in tackling this global emergency, which is why all offices have been closed indefinitely, and our employees are now operating from the safety of\r\n                                                            their homes. We are also providing our teams with the most up-to-date information on the ever-changing situation.</p>\r\n                                                        <p class=\"copy-16-lt\">In these difficult times, it\'s always important to look out for each other and lend a helping hand where we can. I wish you and your family good health as we navigate the road ahead.</p>\r\n                                                        <p class=\"copy-16-lt\">Gratefully Yours,</p>\r\n                                                        <p class=\"copy-16-tp\">Ahasan Habib<br>CEO</p>', 'Murshid', '1585215069'),
(2, 'Testing Purpose', 'tb_subscribers', '<p>this is test email<br></p>', 'Murshid', '1585215408'),
(3, 'Testing Purpose', 'tb_subscribers', '<p>Testing message<br></p>', 'Murshid', '1585222003'),
(4, 'Testing Purpose', 'tb_subscribers', '<p>This is testing email.<br></p>', 'Murshid', '1585222154'),
(5, 'What is Lorem Ipsum?', 'tb_subscribers', '<p><strong>Lorem Ipsum</strong> is simply dummy text of the printing and \r\ntypesetting industry. Lorem Ipsum has been the industry\'s standard dummy\r\n text ever since the 1500s, when an unknown printer took a galley of \r\ntype and scrambled it to make a type specimen book. It has survived not \r\nonly five centuries, but also the leap into electronic typesetting, \r\nremaining essentially unchanged. It was popularised in the 1960s with \r\nthe release of Letraset sheets containing Lorem Ipsum passages, and more\r\n recently with desktop publishing software like Aldus PageMaker \r\nincluding versions of Lorem Ipsum.</p>', 'Murshid', '1585223787'),
(6, 'What is Lorem Ipsum?', 'tb_subscribers', '<p><strong>Lorem Ipsum</strong> is simply dummy text of the printing and \r\ntypesetting industry. Lorem Ipsum has been the industry\'s standard dummy\r\n text ever since the 1500s, when an unknown printer took a galley of \r\ntype and scrambled it to make a type specimen book. It has survived not \r\nonly five centuries, but also the leap into electronic typesetting, \r\nremaining essentially unchanged. It was popularised in the 1960s with \r\nthe release of Letraset sheets containing Lorem Ipsum passages, and more\r\n recently with desktop publishing software like Aldus PageMaker \r\nincluding versions of Lorem Ipsum.</p>', 'Murshid', '1585224229'),
