INSERT INTO `tb_others` (`id`, `name`, `title`, `description`, `first`, `second`, `third`, `forth`, `fifth`, `photos`, `visibility`, `time`) VALUES
(1, 'About', 'A Better Way To Shop Goods From Online', 'This is more than just an online store.  You can easily fill up your demands by looking for goods on our online store and more from the comfort of your own home. Our mission is to ensure pure food products to your door-step for achieving your trust. Our vision is to provide 100% halal, fresh & unadulterated foods in the competitive market of contaminated foods all over Bangladesh.', 'Our Customer Care Team can answer any questions you may have, as well as provide personalized assistance with: scheduling, availability, bulk orders, custom orders and delivery options.', 'We have fixed two categories for selling our products- General & Aristocrat level.', 'Shop with confidence! Our Satisfaction Guarantee and Price Match Promise ensure you are always happy with your purchase.', 'Our one of a kind delivery network is fast and reliable. Delivery charge is very reasonable for your service.', NULL, '', 1, '1594551704'),
(2, 'Contact', 'No Title for this page.', 'Please view our FAQ to find answers to your questions or send us an email for general questions! Due to unexpected volumes, it is taking us a little longer than we would like to respond to emails. Our current email response time is 2 business days.', '24/1, Nolvogh Main Road (Rupayan City Gate) Sector # 12, Uttara, Dhaka - 1230, Bangladesh', '01636-755412', 'E-mail:- salviaemporium07@gmail.com or Website:- www.sobujpatagroup.com', '', NULL, '', 1, '1594648245');
INSERT INTO `tb_policies` (`id`, `name`, `body`, `status`, `visibility`, `time`) VALUES
(1, 'privacy', '<h3>Who Are We?</h3>\r\n                    <p class=\"text-justify\"><b>salviaemporium.com</b> offers online shopping in Bangladesh for all kinds of Mustard Oil, Coconut Oil, Cumin Powder, Coriander Powder, Chilli Powder, Turmeric Powder, Ghee, Chui Jhal and Pure Honey from Sundarbans at reasonable price. Corporate office located at House # 24/A, Flat # A1, Nolvog Main Road Rupayan City Gate, Sector # 12, Uttara, Dhaka - 1230, Bangladesh.</p>\r\n                    <h3 class=\"privacyhtwo\" style=\"font-size: 1.8rem;\">What Do We Do with Your Information?</h3>\r\n                    <p class=\"text-justify\">Our eCommerce website may collect various type of required information if you want to place an order for the desired product you want to buy from us using the website. When you purchase something from our online store through the website, as part of the buying and selling process, we collect the personal information you give us such as your name, address and email address. We will receive, store and process your data for preparing your purchase order on our eCommerce site and will save it for any possible future allegation. We usually collect personal information such as your title, name, gender, date of birth, email address, postal address, delivery address (if different), telephone number, mobile number, payment procedure and another similar kind of information. When you browse our store, we also automatically receive your computers internet protocol (IP) address in order to provide us with information that helps us learn about your browser and operating system. With your permission, we may send you emails about our store, new products, and other updates.</p>\r\n                    <h3 class=\"privacyhtwo\">Third Party Policy</h3>\r\n                    <p class=\"text-justify\" style=\"font-size: 17px;\">We may pass your details to other companies affiliated with us only for the purpose of providing you better service. We may somewhat pass your details to our agents and subcontractors to help with analyzing data and providing us with marketing or customer service assistance. We may also use third parties to assist us with delivering products to you and to help us to collect payments from you. In general, the third-party providers used by us will only collect, use and disclose your information to the extent necessary to allow them to perform the services they provide to us. However, certain third-party service providers, such as payment gateways and other payment transaction processors, have their own privacy policies in respect to the information we are required to provide to them for your purchase-related transactions.</p>\r\n                    <h3 class=\"privacyhtwo\">Security of Your Information</h3>\r\n                    <p class=\"text-justify\" style=\"font-size: 18px;font-style: normal;\">To protect your personal information, we take reasonable precautions and follow industry best practices to make sure it is not inappropriately lost, misused, accessed, disclosed, altered or destroyed. If you provide us with your credit card information, the information is encrypted using secure socket layer technology (SSL). Although no method of transmission over the Internet or electronic storage is 100% secure, we follow all PCI-DSS requirements and implement additional generally accepted industry standards. We may disclose your personal information if we are required by law to do so or if you violate our Terms of Service. Visit our Terms and Conditions page to learn more about our complete terms of service.</p>\r\n                    <h3 class=\"privacyhtwo\">Your Right to Withdraw &amp; Change</h3>\r\n                    <p class=\"text-justify\">If you change your mind, you may withdraw your consent.&nbsp; In this regard, you have to inform us&nbsp; within 12 hours of placing your order. For more information contact us at <strong>salviaemporium07@gmail.com</strong> or Call us on +8801636755412<br><strong></strong></p><p class=\"text-justify\"><strong><br></strong></p>', 0, 1, '1594732561'),
(2, 'return', '<h3 class=\"privacyhtwo\">What is the procedure to return a product?</h3>\r\n                    <p class=\"text-justify\">You have 2 calendar days after item delivery, to notify us that you want to return your product. If your item meets all the requirements, your return can be initiated by calling our Customer Service at +8801636755412 or notify us through salviaemporium07@gmail.com.<br></p>\r\n                    <h3 class=\"privacyhtwo\"><span class=\"text-underline\">Simply follow the 6 steps stated below:</span></h3>\r\n                    <p><i><span class=\"text-underline\">Step 1</span></i><i>: Check if your product meets all the conditions for returning a product.</i></p>\r\n                    <p><i><span class=\"text-underline\">Step 2</span></i><i>: Contact Salvia emporiums Customer Service to submit a complaint/request for return.</i></p>\r\n                    <p><i><span class=\"text-underline\">Step 3</span></i><i>: Fill in the return form given with the invoice.</i></p>\r\n                    <p><i><span class=\"text-underline\">Step 4</span></i><i>: Choose your preferred method of product return when you call Customer Service.</i></p>\r\n                    <p><i><span class=\"text-underline\">Step 5</span></i><i>: Your returned product will go through a Quality Check.</i></p>\r\n                    <p><i><span class=\"text-underline\">Step 6</span></i><i>: If validated, you will get product Return / Replacement.</i></p>\r\n                    <p>NOTE:</p>\r\n                    <p> You must show the original Customer Copy of the Invoice to authenticate your purchase, at the time of handing over the product.</p>\r\n                    <p><span style=\"font-size: small;\"><i><span class=\"text-underline\">salviaemporium.com has the easiest 2 Days Easy Return Policy.</span></i></span></p>\r\n                    <h3 class=\"privacyhtwo\">How much time do you have to return a product?</h3>\r\n                    <p class=\"text-justify\">Items sold on salviaemporium.com can be returned within a period of 2 calendar days from the delivery date, provided they are eligible for return. For example: If you receive your product on the 5th of any month, you have time until the 7th of that month to contact Salviaemporiums Customer Service centre. Customer Service agents are available from 9:00 am  10:00 pm, 7 days a week (except on national holidays e.g Eid).</p>\r\n                    <p>NOTE:</p>\r\n                    <p class=\"text-justify\"> You have 2 calendar days from the day you receive your purchased product, to call salviaemporium.com to ensure your return. Unfortunately, we will not accept returns past 2 days of your product delivery, or if you don\'t have the original copy of the Customer Copy Invoice. If the nature of your complaint refers to damages, we advise you to check if your product has a warranty. Visit our <span class=\"text-underline\"><span style=\"color: #0000ff;\"><a title=\"Warranty Policy\" href=\"https://www.salviaemporium.com/warranty-policy\" target=\"_blank\"><span style=\"color: #0000ff; text-decoration: underline;\">W<span style=\"color: #0000ff; text-decoration: underline;\"><span style=\"color: #0000ff; text-decoration: underline;\">arranty Policy</span></span></span></a></span></span> page for more details.</p>\r\n                    <p class=\"text-justify\"></p>\r\n                    <h3 class=\"privacyhtwo\">How do I request for a return?</h3>\r\n                    <ul>\r\n                        \r\n                        <li><span class=\"text-underline\">Option 1</span>: By calling Salvia emporiums Customer Service on +8801636755412</li>\r\n                        <li><span class=\"text-underline\">Option 2</span>: Directly drop off the product at the office premises or by post by Sundarban Courier Service.</li>\r\n                        \r\n                    </ul>', 0, 1, '1594643599'),
(3, 'warranty', '<p class=\"text-justify\">salviaemporium.com prioritizes the safety and security of customers through various warranty facilities such as Brand Warranty and Service Warranty.<br></p>\r\n                    <p class=\"text-justify\">All these warranty facilities give you limited warranty rights from salviaemporium.com. The Limited Warranty Time Period starts on the date of purchase from salviaemporium.com. The limited warranty applies to the&nbsp; products&nbsp; purchased from <a title=\"Salviaemporium.com\" href=\"https://salviaemporium.com\" target=\"_blank\"><span class=\"text-underline\"><span style=\"color: #0000ff; text-decoration: underline;\">Online Shop salviaemporium.com</span></span></a>.</p><ul>\r\n                        <li>Before the product undergoes any Servicing process, the Customer must pay the Servicing Fee in full. If the fee is not paid, the Servicing Process cannot begin.</li>\r\n                        <li>salviaemporium.com will run Quality Control test to ensure the validity of the product complaint. If the complaint or issues are found to be valid, then salviaemporium will take appropriate measures to rectify the issue complained about&nbsp; salviaemporium may also send the product to their authorized seller, for expert opinion.</li>\r\n                        <li>The servicing process may take 7-15 working days, depending on the product type.</li>\r\n                        \r\n                        \r\n                        <li>In an event, where more than 2 calendar days have passed after product delivery, you will no longer be able to claim a return or replacement of your purchased product. However, if the product has a warranty, it will be included within the packaging and can be used to claim the product warranty. All you need to do is make a call to our customer service to claim warranty service.</li>\r\n                    </ul>\r\n                    <h3 class=\"privacyhtwo\">How Will I Get Warranty If I Live Outside Dhaka?</h3>\r\n                    <p class=\"text-justify\">If you live outside Dhaka, you can send your product via Sundarban Courier Service. After receiving your product, it will take 7-15 working days, depending on the product and its category, to ensure the servicing of your product and its delivery back to you.</p>\r\n                    \r\n                    <p class=\"text-justify\"><br></p>', 0, 1, '1594643776'),
(4, 'shipping', '<h3 class=\"privacyhtwo\">How do we Deliver?</h3>\r\n                    <p>We process all deliveries through:</p>\r\n                    <ul>\r\n                        <li>Home Delivery<br></li>\r\n                        <li>Reputed couriers</li>\r\n                    </ul>\r\n                    <h3 class=\"privacyhtwo\">How much are the delivery charges?</h3>\r\n                    <p>Within Dhaka city, delivery charge is BDT 60 and outside Dhaka city it is BDT 100.</p>\r\n                    <strong>Note:</strong>\r\n                    <p>This will vary from product to product</p>\r\n                    <h3 class=\"privacyhtwo\">What is the estimated delivery time?</h3>\r\n                    <p>The estimated time of delivery for Order inside Dhaka city up to 2 Working days &amp; for outside Dhaka up to 4 working days.</p>\r\n                    <strong>Note:</strong>\r\n                    <ul>\r\n                        <li>Any order placed after 6 pm will be considered as order of next business day, not as same day.</li>\r\n                        <li>Business Day: Saturday to Thursday except public holidays.</li>\r\n                        <li>Delivery might be delayed due the unavailability of the product or delay from the 3rd Party Delivery Service.</li>\r\n                    </ul>', 0, 1, '1595241922'),
(5, 'terms', '<h3>OVERVIEW</h3>\r\n                    <p class=\"text-justify\">This website is operated by&nbsp; Salviaemporium.com. The terms We, Us and Our are used to refer to only Salviaemporium.com. Salviaemporium.com offers all information, tools and services which are used or concerns Salviaemporiums carrying out of business, and are publicly available at the website. The user shall be deemed to have accepted all the terms, conditions, policies and notices officially stated, as they continue to use the website and its services.</p>\r\n                    <p class=\"text-justify\">By visiting our website and/or purchasing something from us, you become a user of the website and engage in our Services. Such engagement will consecutively mean the user agreeing to be bound by the following terms and conditions (also referred to as Terms of Service, Terms of use or Terms), including those additional terms &amp; conditions and policies referenced herein and/or available by hyperlink. These Terms of Service apply to all users of the website including, but not limited to, users who are browsers, vendors, customers, merchants, affiliations and/ or contributors of content.</p>\r\n                    <p class=\"text-justify\">Please read this Terms of Service carefully before accessing or using our website or our services. By accessing or using any part of the website, you agree to be legally bound by these Terms of Service. If you do not agree to all the Terms of this agreement, then you may not access the website or use any of the services.</p>\r\n                    <p class=\"text-justify\">Any new addition of features, service or tools shall also be deemed to be subject to the Terms of Service in force. You can review the most current version of the Terms of Service at any time on this page. We reserve the right to update, change or replace any part of these Terms &amp; Conditions by posting updates and/or changes to our website. Therefore in order to stay updated on the Terms, please check this page periodically for changes. Your continued use of, or access to the website, following the posting of any changes constitutes acceptance of those changes.</p>\r\n                    <h3 class=\"privacyhtwo\">SECTION 1  GENERAL CONDITIONS</h3>\r\n                    <p class=\"text-justify\">By agreeing to these Terms of Service, you represent that you are at the age of majority in your present State or Province of residence, or that you have given us your consent to allow any of your minor dependents to use this website where you are the age of majority in your State or Province of residence.</p>\r\n                    <p class=\"text-justify\">You may not use our products for any illegal or unauthorized purpose nor may you, in the use of the Service, violate any laws in your jurisdiction (including but not limited to copyright laws). You must not transmit any worms or viruses or any code of a destructive nature. A breach or violation of any of the Terms will result in an immediate termination of your Services.</p>\r\n                    <p class=\"text-justify\">We reserve the right to refuse service to anyone for any reason at any time. You understand that your content (not including credit card information), may be transferred unencrypted and may involve.</p><p class=\"text-justify\">You agree not to reproduce, duplicate, copy, sell, resell or exploit any portion of the Service, use of the Service, or access to the Service on the website through which the service is provided, without express written permission by us.</p>\r\n                    <h3 class=\"privacyhtwo\">SECTION 2  AVAILABILITY, PRICING AND PAYMENT METHODS</h3>\r\n                    <p class=\"text-justify\">Availability and pricing of all items are subject to availability. Salviaemporium.com will inform you as soon as possible, if the product(s) and services you have ordered are not available. If not, then the Customer Care will offer similar alternatives.</p>\r\n                    <p class=\"text-justify\">As part of visiting and/or purchasing anything from Salviaemporium, you warrant to agree to understand that due to the nature of the business, availability may change even after an order has been placed. In an event where the product is no longer available, the Customer Care will offer alternatives or the option to cancel your order wholly.</p>\r\n                    <p class=\"text-justify\">Pre-book products/items delivery date will be determined by Salviaemporium.com and the respective brands. Delivery date will be mentioned on the specification of the product page. For delivery delay respective brands are liable. Delivery time of regular or salviaemporium office collection orders will not be applicable for pre-book orders.</p>\r\n                    <p class=\"text-justify\">All prices are subject to change without notification, and while every effort is made to ensure the accuracy of the prices displayed on Salviaemporium.com, they are not guaranteed to be accurate. If any price is different from that displayed we will inform you before dispatching the order and you will have the option of continuing with the order or not.</p>\r\n                    <p class=\"text-justify\">We reserve the right at any time to modify or discontinue any Service (or any part or content thereof) without notice at any time. We shall not be liable to any customer or to any third-party for any modification, price change, suspension or discontinuance of the Service.</p>\r\n                    <p class=\"text-justify\">Choosing the right payment method is essential in order to shop with online stores. Salviaemporium is accepting payments in four very easy and convenient ways. The chart of the payment methods of Salviaemporium.com is given below:</p>\r\n                    <table class=\"table\">\r\n                        <thead>\r\n                            <tr class=\"danger\">\r\n                                <th><strong>Payment Method</strong></th>\r\n                                <th><strong>Condition</strong></th>\r\n                            </tr>\r\n                        </thead>\r\n                        <tbody>\r\n                            <tr class=\"info\">\r\n                                <td>Cash on Delivery</td>\r\n                                <td>For orders valuing more than BDT 10 excluding delivery cost</td>\r\n                            </tr>\r\n                            <tr class=\"info\">\r\n                                <td>Card on Delivery</td>\r\n                                <td>For orders valuing more than BDT 1000 excluding delivery cost</td>\r\n                            </tr>\r\n                            <tr class=\"info\">\r\n                                <td>Online Payment</td>\r\n                                <td>Applicable for any ordered amount as per company policy</td>\r\n                            </tr>\r\n                            <tr class=\"info\">\r\n                                <td>bKash Payment</td>\r\n                                <td>To avail Bkash payment you have to bear Bkash payment charge like- It will cost 20tk (twenty) for one thousand Bkash payment.<br></td>\r\n                            </tr>\r\n                        </tbody>\r\n                    </table>\r\n                    <p><strong>Note:</strong> For order less than BDT 1000 customers need to make advance payment.</p>\r\n                    <h3 class=\"privacyhtwo\">SECTION 3  PRODUCTS</h3>\r\n                    <p class=\"text-justify\">Products are available exclusively online through Salviaemporium.com. These products or services may have limited quantities and are subject to return or exchange only according to our <a title=\"Return &amp; Replacement\" href=\"https://www.salviaemporium.com/return-replacement\" target=\"_blank\"><span style=\"text-decoration: underline; color: #0000ff;\">Return and Replacement Policy</span></a>.</p>\r\n                    <p class=\"text-justify\">Salviaemporium has made every reasonable effort to be as accurate as possible in displaying the product in its original color and accurate size. However, due to your devices display settings, technical issues and differences in display, variations may come to the products color or size. Hence, Salviaemporium cannot guarantee that the physical product will look exactly like the display image. If a product from Salviaemporium is not as described, your sole remedy is to return it unused by fulfilling all the conditions as per our <a title=\"Return &amp; Replacement\" href=\"https://www.salviaemporium.com/return-replacement\" target=\"_blank\"><span style=\"text-decoration: underline; color: #0000ff;\">Return and Replacement Policy</span></a>.</p>\r\n                    <p class=\"text-justify\">We reserve the right, but are not obligated, to limit the sales of our products or Services to any person, geographic region or jurisdiction. We may exercise this right on a case-by-case basis. We reserve the right to limit the quantities of any products or services that we offer, at any time. All descriptions of products or product pricing are subject to change at any time without notice, at the sole discretion of us. We reserve the right to discontinue any product at any time.</p>\r\n                    <h3 class=\"privacyhtwo\">SECTION 4  ACCURACY OF BILLING AND ACCOUNT INFORMATION</h3>\r\n                    <p class=\"text-justify\">We reserve the right to refuse any order you place with us. We may, in our sole discretion, limit or cancel quantities purchased per person or per order. These restrictions may include orders placed by or under the same customer account, the same credit card, and/or orders that use the same billing and/or shipping address. In the event that we make a change to or cancel an order, we may attempt to notify you by contacting through the phone number or e-mail provided at the time the order was placed. We reserve the right to limit or prohibit orders that, in our sole judgment, appear to be placed by dealers, resellers or distributors.</p>\r\n                    <p class=\"text-justify\">As a visitor or a customer, you agree to provide current, complete and accurate account information for all purchases made at our store. You also agree to promptly update your account and other information, including your email address and credit card numbers and expiration dates, so that we can complete your transactions and contact you as needed.</p>\r\n                    <p class=\"text-justify\">Each user accounts must be created under one distinctive registered Cell Phone number, and email address of the user. Multiple accounts cannot be created under the same information as mentioned. In such an event the user cannot avail more than once any of the offers, deals, discount coupons, or Gift Coupons during campaigns or other occasional sales.</p>\r\n                    <h3 class=\"privacyhtwo\">SECTION 5  DISCOUNTS &amp; ALLOWANCES</h3>\r\n                    <p class=\"text-justify\">Discounts and allowances (Coupon code, Promo code, Gift card code, Adjustment code, App discount, Occasional offers or sign-up offer etc.) are reductions of the basic price of products or services. The value of the discount coupon or gift card will not be refunded on returns or exchanges after using for a successful order from Salviaemporium.com. Users having multiple accounts under the same Cell Phone number, or email address cannot avail the discounts or offers more than once, as is the policy. Promotional SMS may only contain the main content of the offer but terms and conditions are mentioned on the website. Salviaemporium.com holds the right to change/revise/modify any Discount offers OR Promotional Allowances without prior notice. Customer is entitled to comply accordingly. Customers cannot avail multiple discount offers in a single order. For example if a customer uses 2X vouchers then he cannot use reward points or any other discount along with the ordered item</p>\r\n                    <h3 class=\"privacyhtwo\">SECTION 6  THIRD PARTY LINKS</h3>\r\n                    <p class=\"text-justify\">Certain content, products and services available via our Service may include wholly or partly, materials from third-parties only for the purpose of providing you with better service.</p>\r\n                    <p class=\"text-justify\">Third-party links on this site may direct you to third-party websites that are not affiliated with us. We are neither responsible for examining or evaluating the content or accuracy, nor do we warrant any liability for third-party materials, website content, services or any other materials from third-parties.</p>\r\n                    <p class=\"text-justify\">We are not liable for any harm or damages related to the purchase or use of goods, services, resources, content, or any other transactions made in connection with any third-party websites. Please review carefully the third-party\'s policies and practices and make sure you understand them before you engage in any transaction. Any complaints, claims, concerns, or questions regarding third-party products or services should be directed to the third-party.</p>\r\n                    <p class=\"text-justify\">Learn more about this by reading our <a title=\"Privacy Policy\" href=\"https://www.salviaemporium.com/privacy-policy\" target=\"_blank\"><span style=\"text-decoration: underline; color: #0000ff;\">Privacy Policy</span></a>.</p>\r\n                    <h3 class=\"privacyhtwo\">SECTION 7  PERSONAL INFORMATION</h3>\r\n                    <p class=\"text-justify\">Your submission of personal information through the store is governed by our Privacy Policy. Visit our website to learn more about our <a title=\"Privacy Policy\" href=\"https://www.salviaemporium.com/privacy-policy\" target=\"_blank\"><span style=\"text-decoration: underline;\"><span style=\"color: #0000ff; text-decoration: underline;\">Privacy Policy</span></span></a>.</p>\r\n                    <h3 class=\"privacyhtwo\">SECTION 8  ERRORS, INACCURACIES AND OMISSIONS</h3>\r\n                    <p class=\"text-justify\">Occasionally there may be information on our website or some Services containing typographical errors, inaccuracies or omissions that may relate to product descriptions, pricing, promotions, offers, product shipping charges and availability. We reserve the right to correct any errors, inaccuracies or omissions, and to change or update information or cancel orders if any information, on our or on any related website, is inaccurate at any time without prior knowledge (including after you have submitted your order or concern).</p>\r\n                    <p class=\"text-justify\">We undertake no obligation to update, amend or clarify information on our or on any related website, including without limitation, pricing information, except as required by law.</p>\r\n                    <p class=\"text-justify\">No specified update or refresh date applied in the Service or, on any related website, should be taken to indicate that all information in the Service or on any related website has been modified or updated.</p>\r\n                    <h3 class=\"privacyhtwo\">SECTION 9  ORDER CANCELLATION</h3>\r\n                    <p class=\"text-justify\">Salviaemporium.com promises to deliver quality and authentic products to their customers. Therefore, Salviaemporium always runs Quality Control checks after receiving the ordered product from the authorized vendors. Salviaemporium reserves all rights to cancel any order of the customer after finding any quality issue from Quality Control checks of the ordered product, as we aim to give our customers the best online shopping experience.</p>\r\n                    <p class=\"text-justify\">Salviaemporium.com also reserves all rights to cancel any order if the ordered product is unavailable or if it is out-of-stock. Product unavailability cannot be predetermined or predicted by the website, whether it is due to unavoidable inventory management issues, website management issues, vendor stock update issues or any other unpredictable reason.</p>\r\n                    <h3 class=\"privacyhtwo\">SECTION 10  PROHIBITED USES</h3>\r\n                    <p class=\"text-justify\">In addition to other prohibitions as set forth in the Terms of Service, you are prohibited from using the website or its contents:</p>\r\n                    <p class=\"text-justify\">(a) For any unlawful purpose.<br> (b) To solicit others to perform or participate in any unlawful acts.<br> (c) To violate any international, federal, provincial or national regulations, rules, laws, or local ordinances.<br> (d) To infringe upon or violate our intellectual property rights or the intellectual property rights of others.<br> (e) To harass, abuse, insult, harm, defame, slander, disparage, intimidate, or discriminate based on gender, sexual orientation, religion, ethnicity, race, age, national origin, or disability.&nbsp;<br> (f) To submit false or misleading information.&nbsp;<br> (g) To upload or transmit viruses or any other type of malicious code that will or may be used in any way that will affect the functionality or operation of the Service or of any related website, other websites, or the Internet.<br> (h) To collect or track the personal information of others.<br> (i) To spam, phish, pharm, pretext, spider crawl, or scrape.<br> (j) For any obscene or immoral purpose.<br> (k) To interfere with or circumvent the security features of the Service or any related website, other websites, or the Internet. <br> (l) Fake orders of any kind are not accepted and customers need to choose the method of payments as per company policy in order to receive deliveries of the products. Example: Customers not receiving an order after confirming it intentionally will be counted as a fake order.</p>\r\n                    <p class=\"text-justify\">We reserve the right to terminate your use of the Service or any related website for violating any of the prohibited uses.</p>\r\n                    <h3 class=\"privacyhtwo\">SECTION 11 - DISCLAIMER OF WARRANTIES; LIMITATION OF LIABILITY</h3>\r\n                    <p class=\"text-justify\">We do not guarantee, represent or warrant that your use of our service will be uninterrupted, timely, secure or error-free. We do not warrant that the results that may be free from error obtained from the use of the service will be accurate or reliable. User must understand that, from time to time we may remove the service for indefinite periods of time or cancel the service at any time, without prior notice to you, under different circumstances.</p>\r\n                    <p class=\"text-justify\">You expressly agree that your use of, or inability to use the service is solely your risk. The service and all products and services delivered to you through the service are (except as expressly stated by us) provided \'as is\' and \'as available\' for your use, without any representation, warranties or conditions of any kind, either express or implied, including all implied warranties or conditions of merchantability, merchantable quality, fitness for a particular purpose, durability, title, and non-infringement.</p>\r\n                    <p class=\"text-justify\">In no case shall Salviaemporium, our directors, officers, employees, affiliates, agents, contractors, interns, suppliers, vendors, service providers will be liable for any injury, loss, claim, or any direct, indirect, incidental, punitive, special, or consequential damages of any kind, including, without limitation, lost profits, lost revenue, lost savings, loss of data, replacement costs, or any similar damages, whether based in contract, tort (including negligence), strict liability or otherwise, arising from your use of any of the service or any products procured using the service, or for any other claim related in a