-party.</p>\r\n                    <h3 class=\"privacyhtwo\">SECTION 13  SEVERABILITY</h3>\r\n                    <p class=\"text-justify\">In the event that any provision of these Terms of Service is determined to be unlawful, void or unenforceable, such provision shall nonetheless be enforceable to the fullest extent permitted by applicable law, and the unenforceable portion shall be deemed to be severed from these Terms of Service, such determination shall not affect the validity and enforce ability of any other remaining provisions.</p>\r\n                    <h3 class=\"privacyhtwo\">SECTION 14  TERMINATION</h3>\r\n                    <p class=\"text-justify\">The obligations and liabilities of the parties incurred prior to the termination date shall survive the termination of this agreement for all purposes. These Terms of Service are effective unless and until terminated by either you or us. You may terminate these Terms of Service at any time by notifying us that you no longer wish to use our Services, or when you cease using our site.</p>\r\n                    <p class=\"text-justify\">If, in our sole judgment, you fail or we suspect that you have failed to comply with any term or provision of these Terms of Service, we also may terminate this agreement at any time without notice and you will remain liable for all amounts due up to and including the date of termination; and/or accordingly may deny you access to our Services (or any part thereof as may be deemed fit).</p>\r\n                    <p class=\"text-justify\">The failure of us to exercise or enforce any right or provision of these Terms of Service shall not constitute a waiver of such right or provision. Any ambiguities in the interpretation of these Terms of Service shall not be construed against the drafting party.</p>\r\n                    <p class=\"text-justify\">These Terms of Service and any policies or operating rules posted by us on this site or in respect to The Service constitutes the