(2, 'Tahsina Khatun', 'Managing Director', 'sweety.jpg', 'Tahsina has always focused on exceptional customer service, attention to detail and offering a friendly, professional and detail-oriented approach for every customer shopping with her team.', 'https://facebook.com', 'https://linkedin.com', 'https://instagram.com', 1, 1, 1, '1594556358'),
(3, 'Raju Ahmed', 'Asst. Manager', 'raju.jpg', 'Raju has over 5 years experience in the Marketing and Advertising world. He held several senior marketing roles in the automotive business working for Volvo Cars of North America, LLC.', 'https://facebook.com', 'https://linkedin.com', 'https://instagram.com', 1, 1, 1, '1594556337');
